import React, { useEffect, useState } from "react";
import './style.css'


const Navbar = () => {

  return (
    <>
      <div className="logo">
        <span className='logo-text-de'> &nbsp; news </span> <span className='logo-text-crypto'>app </span>
      </div>

      <div className="description">
        <p> News app for cryptocurrency </p>
      </div>
      
      
    </>
  )
}

export default Navbar;
